import Timer from "./Timer/timer";
import React from "react";

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Sugar',
    'Blood',
    'Asthma',
    'Broken Stuff',
];

function HandleClick() {

}

export function HomePage() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button" onClick={HandleClick}>
            {name}
        </button>
    ));

    return (
            <div className="button-container">
                <button id={'login'} className={"loginButton"}>Login</button>
                <button id={'Register'} className={"registerButton"}>Register</button>
                {buttons}
                <div className="emergency-container">
                    <button className="emergency-button">EMERGENCY</button>
                </div>
                <Timer/>
            </div>
    );
}

export default HomePage;
